\section*{Problem: Stepwise Formation of a Nickel(II) –1,2-Diaminopropane Complex}

We are given the following information:

\begin{itemize}
    \item  [1.] Aqueous solution: [1.00 L], [25°C]
    \item  [2.] [1,2-diaminopropane] is adjusted to [0.120 M]
    \item  [3.] Stepwise formation constants at [25°C]:
    \begin{itemize}
        \item  Ni²⁺ + dap \equiv K₁
        \item  Ni(dap)²⁺ + dap \equiv K₂
        \item  Ni(dap)₂²⁺ + dap \equiv K₃
    \end{itemize}
\end{itemize}

Calculate the equilibrium concentration of free Ni²⁺ (in M).

\textbf{Step 1:} We need to find the equilibrium concentration of Ni²⁺.  The equilibrium concentration of a species is the concentration of that species at equilibrium. In this case, we want to find the concentration of Ni²⁺.

\textbf{Step 2:} We know that the initial concentration of Ni²⁺ is [1.00 mol] and it is at equilibrium.  The total number of moles of Ni²⁺ is [1.00 mol].  We can use the equilibrium expression for the formation constant to solve for the equilibrium concentration of Ni²⁺.

\textbf{Step 3:}  We can use the equilibrium expression for the formation constant to determine the equilibrium concentration.  The equilibrium expression is:

\[
K = \frac{\Delta[Ni²⁺]}{[Ni²⁺]}
\]

where $\Delta[Ni²⁺]$ is the change in concentration of Ni²⁺. In this case, $\Delta[Ni²⁺] = [0.120 M] - [0.0400 mol] = 0.0800 mol^-1$.

\textbf{Step 4:}  Substitute this value into the equilibrium expression:

\[
3.50 \times 10^6 = \frac{0.0800}{0.0400}
\]

\[
3.50 \times 10^6 = 2.00
\]

Since this equation is not true, the initial concentration of Ni²⁺ is not [1.00 mol].
\end{itemize}

Therefore, the equilibrium concentration of free Ni²⁺ is [1.00 mol].

\boxed{{1.00 mol}}

